    false,nt"url": null,nt"notes": "This metadata applies to the following
    collection area(s): Essex County 2005 1m and related SLOPE datasets. Created using
    ArcGIS "SLOPE" command to produce change in elevation over the distance between
    the cell and its eight neighbors expressed in percent slope or percent grade, i.e.,
    rise/run * 100. This metadata complies with the VT Geodata Portal format and applies
    to thematic layers with the same resolution (RESCLASS), e.g., 0p7m, 1m etc., and
    may include multiple data "collection" efforts. For the original vendor metadata
    containing specific details on each collections "point cloud" such as flight dates,
    nominal pulse spacing and RMSEz etc., see the "All Available LiDAR" Product page:
    (http://vcgi.vermont.gov/warehouse/products/ALL-LDR_MIX_LIDAR_STATE_ALL). For an
